import React from 'react'
import './index.sass'

export default function Landing({ onRegister, onLogin }) {
    return  <> 
        <section className="landing">
            <div className="landing__container container">
                <h1 className="container__title">Welcome to Gnomes Land</h1>
                <p className="container__options">Please, proceed to <div href="" onClick={event => {
                    event.preventDefault()

                    onRegister()
                }}> Register</div> or <div href="" onClick={event => {
                    event.preventDefault()

                    onLogin()
                }}> Login</div></p>
            </div>
         </section>
    </>
}
